import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  const handleLogin = () => {
    navigate('/login');
  };

  const handleRegister = () => {
    navigate('/register');
  };

  return (
    <div>
      <h1>Witaj w swojej książce kontaktowej, miłego kontatkowania</h1>
      <p>Co chciałbyś teraz zrobić?</p>
    </div>
  );
}

export default Home;
